import React from "react";

function AddQuestionsPopup() {
  return (
    <div
      style={{
        paddingBottom: "7vh",
        paddingTop: "6vh",
        paddingRight: "2.5vw",
        paddingLeft: "2.5vw",
        marginLeft: "3vw",
        backgroundColor: "white",
        borderRadius: "10px",
        width: "40vw",
      }}
    >
      AddQuestionsPopup
      
    </div>
  );
}

export default AddQuestionsPopup;
